import { Grid, Typography } from '@mui/material';
import '../../../style/home.css';
import logo from '../../../photo/png/logo-color.png';
function Home() {
  return (
    <Grid
      className="home-page"
      container
      direction="row"
      justifyContent="center"
      alignItems="center"
    >
      <Grid item className="home-items text-item" xs={5}>
        <Typography
          color="#00d1cd"
          variant="h2"
          style={{ marginBottom: '20px' }}
        >
          {'DK IT SERVICES'}
        </Typography>
        <Typography color="white" variant="h5" style={{ marginBottom: '10px' }}>
          {'Vitajte v DK IT SERVICES, kde programovanie žije!  '}
        </Typography>
        <Typography color="white">
          {
            'Sme tím vášnivých programátorov, ktorí prinášajú inovácie do digitálneho sveta. Naša špecialita je vytvárať výnimočné softvérové riešenia, ktoré posúvajú vaše podnikanie vpred.'
          }
        </Typography>
        <Typography color="white">
          {
            'S nami získate programovanie na najvyššej úrovni a osobný prístup. Spolupracujeme s vami, aby sme pochopili vaše potreby a dosiahli vaše ciele. Vaše myšlienky pretvárame do kódu a pomáhame vám získať konkurenčnú výhodu..'
          }
        </Typography>
        <Typography color="white">
          {
            'Spojte sa s nami a začnite písať úspešný digitálny príbeh. DK IT SERVICES je tu pre vás, aby sme vytvorili programovacie dielo, ktoré prekoná vaše očakávania.'
          }
        </Typography>
        <Typography color="white">
          {
            'Pripojte sa k nám a spolu vytvorme digitálnu budúcnosť. DK IT SERVICES je tu pre vás, aby sme prekonali vaše očakávania a priniesli vaše programovacie projekty na novú úroveň úspechu.'
          }
        </Typography>
        <Typography color="white">
          {
            'Kontaktujte nás ešte dnes a spoločne vytvoríme programovanie, ktoré zmení váš svet!'
          }
        </Typography>
      </Grid>
      <Grid item className="home-items" xs={3}>
        <img className="home-logo" src={logo} alt={'logo'} />
      </Grid>
    </Grid>
  );
}
export { Home };
